import{_ as t,o as r,c as o,e as n}from"./app.0fca7e4d.js";const s={},e=n('<h2 id="\u5B9A\u8BED-attribute" tabindex="-1"><a class="header-anchor" href="#\u5B9A\u8BED-attribute" aria-hidden="true">#</a> \u5B9A\u8BED Attribute</h2><p>\u592A\u597D\u4E86\uFF01\u4F5C\u4E3A\u4F60\u7684\u82F1\u8BED\u4E13\u5BB6\u670B\u53CB\uFF0C\u6211\u4EEC\u4ECA\u5929\u6765\u89E3\u9501\u4E00\u4E2A\u8BA9\u4F60\u7684\u8868\u8FBE\u4ECE\u201C\u9AA8\u67B6\u201D\u53D8\u6210\u201C\u8840\u8089\u201D\u7684\u5173\u952E\u6982\u5FF5\u2014\u2014<strong>\u5B9A\u8BED</strong>\u3002\u5B83\u80FD\u8BA9\u4F60\u63CF\u8FF0\u7684\u4E8B\u7269\u77AC\u95F4\u53D8\u5F97\u751F\u52A8\u3001\u5177\u4F53\u3002</p><h3 id="\u7B2C\u4E00\u90E8\u5206-\u4EC0\u4E48\u662F\u5B9A\u8BED-\u901A\u4FD7\u8BB2\u89E3" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E00\u90E8\u5206-\u4EC0\u4E48\u662F\u5B9A\u8BED-\u901A\u4FD7\u8BB2\u89E3" aria-hidden="true">#</a> \u7B2C\u4E00\u90E8\u5206\uFF1A\u4EC0\u4E48\u662F\u5B9A\u8BED\uFF1F\uFF08\u901A\u4FD7\u8BB2\u89E3\uFF09</h3><p>\u60F3\u8C61\u4E00\u4E0B\uFF0C\u4F60\u8981\u5411\u670B\u53CB\u4ECB\u7ECD\u4E00\u4E2A\u4EBA\uFF1A</p><ul><li>\u201C\u6211\u6709\u4E2A\u670B\u53CB\u3002\u201D \u8FD9\u4E2A\u4FE1\u606F\u5F88\u6A21\u7CCA\uFF0C\u670B\u53CB\u8111\u5B50\u91CC\u6CA1\u6709\u4EFB\u4F55\u5F62\u8C61\u3002\u4F46\u5982\u679C\u4F60\u8BF4\uFF1A</li><li>\u201C\u6211\u6709\u4E2A<strong>\u9AD8\u4E2A\u5B50\u7684\u3001\u5E7D\u9ED8\u7684\u3001\u6765\u81EA\u5317\u4EAC\u7684</strong>\u670B\u53CB\u3002\u201D \u8FD9\u65F6\uFF0C\u4F60\u670B\u53CB\u7684\u8111\u5B50\u91CC\u7ACB\u523B\u5C31\u4F1A\u51FA\u73B0\u4E00\u4E2A\u5177\u4F53\u7684\u5F62\u8C61\u3002</li></ul><p>\u8FD9\u91CC\u9762\uFF0C\u201C\u9AD8\u4E2A\u5B50\u7684\u201D\u3001\u201C\u5E7D\u9ED8\u7684\u201D\u3001\u201C\u6765\u81EA\u5317\u4EAC\u7684\u201D\u5C31\u662F<strong>\u5B9A\u8BED</strong>\u3002</p><p><strong>\u4E00\u53E5\u8BDD\u603B\u7ED3\uFF1A\u5B9A\u8BED\u5C31\u662F\u7528\u6765\u4FEE\u9970\u3001\u9650\u5B9A\u6216\u63CF\u8FF0\u540D\u8BCD\uFF08\u6216\u4EE3\u8BCD\uFF09\u7684\u6210\u5206\uFF0C\u4F7F\u5176\u7279\u5F81\u66F4\u660E\u786E\u3001\u5185\u5BB9\u66F4\u5177\u4F53\u3002\u5B83\u56DE\u7B54\u201C\u4EC0\u4E48\u6837\u7684\uFF1F\u201D\u3001\u201C\u8C01\u7684\uFF1F\u201D\u3001\u201C\u591A\u5C11\uFF1F\u201D\u8FD9\u7C7B\u95EE\u9898\u3002</strong></p><p><strong>\u751F\u6D3B\u5316\u6BD4\u55BB\uFF1A</strong></p><ul><li><strong>\u540D\u8BCD\uFF08\u5982\u201C\u623F\u5B50\u201D\uFF09</strong> \u662F\u4E00\u5F20<strong>\u767D\u7EB8\u4E0A\u7684\u7B80\u7B14\u753B</strong>\u3002</li><li><strong>\u5B9A\u8BED</strong> \u5C31\u662F\u7ED9\u8FD9\u5E45\u753B\u6D82\u4E0A\u7684<strong>\u989C\u8272</strong>\u3001\u6DFB\u52A0\u7684<strong>\u7EC6\u8282</strong>\uFF08\u6BD4\u5982\u201C\u7EA2\u8272\u7684\u201D\u3001\u201C\u6709\u82B1\u56ED\u7684\u201D\u3001\u201C\u6211\u5BB6\u7684\u201D\uFF09\u3002 \u6CA1\u6709\u5B9A\u8BED\uFF0C\u623F\u5B50\u5C31\u662F\u666E\u666E\u901A\u901A\u7684\u623F\u5B50\uFF1B\u6709\u4E86\u5B9A\u8BED\uFF0C\u5B83\u5C31\u6210\u4E86\u201C\u90A3\u5EA7\u6211\u7AE5\u5E74\u4F4F\u8FC7\u7684\u3001\u6709\u7740\u7EA2\u8272\u5C4B\u9876\u7684\u53EF\u7231\u5C0F\u623F\u5B50\u201D\u3002</li></ul><hr><h3 id="\u7B2C\u4E8C\u90E8\u5206-\u4E3A\u4EC0\u4E48\u53EB-\u5B9A\u8BED-\u540D\u79F0\u7684\u7531\u6765" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E8C\u90E8\u5206-\u4E3A\u4EC0\u4E48\u53EB-\u5B9A\u8BED-\u540D\u79F0\u7684\u7531\u6765" aria-hidden="true">#</a> \u7B2C\u4E8C\u90E8\u5206\uFF1A\u4E3A\u4EC0\u4E48\u53EB\u201C\u5B9A\u8BED\u201D\uFF1F\u540D\u79F0\u7684\u7531\u6765</h3><ol><li><p><strong>\u4E2D\u6587\u540D\u201C\u5B9A\u8BED\u201D</strong>\uFF1A</p><ul><li>\u201C\u5B9A\u201D\u662F\u201C\u9650\u5B9A\u3001\u786E\u5B9A\u201D\u7684\u610F\u601D\u3002</li><li>\u6240\u4EE5\u201C\u5B9A\u8BED\u201D\u5C31\u662F<strong>\u7528\u6765\u9650\u5B9A\u548C\u4FEE\u9970\u540D\u8BCD\uFF0C\u4F7F\u5176\u610F\u4E49\u66F4\u786E\u5B9A\u7684\u6210\u5206</strong>\u3002</li></ul></li><li><p><strong>\u82F1\u6587\u540D\u201CAttribute\u201D \u6216 \u201CModifier\u201D</strong>\uFF1A</p><ul><li>\u8BFB\u97F3\uFF1A/\u0259\u02C8tr\u026Abju\u02D0t/ \u548C /\u02C8m\u0252d\u026Afa\u026A\u0259(r)/</li><li><strong>Attribute</strong> \u6765\u6E90\u4E8E\u62C9\u4E01\u8BED <code>attribuere</code>\uFF0C\u610F\u4E3A\u201C\u5206\u914D\u7ED9\u201D\u3001\u201C\u5F52\u5C5E\u4E8E\u201D\u3002\u987E\u540D\u601D\u4E49\uFF0C\u5C31\u662F\u628A\u67D0\u4E2A\u7279\u6027\u201C\u5206\u914D\u201D\u7ED9\u4E00\u4E2A\u540D\u8BCD\u3002</li><li><strong>Modifier</strong> \u66F4\u76F4\u767D\uFF0C\u6765\u81EA\u52A8\u8BCD <code>modify</code>\uFF08\u4FEE\u6539\u3001\u4FEE\u9970\uFF09\uFF0C\u6240\u4EE5 <code>Modifier</code> \u5C31\u662F <strong>\u201C\u4FEE\u9970\u8BED\u201D</strong> \u3002\u8FD9\u4E2A\u540D\u5B57\u5B8C\u7F8E\u89E3\u91CA\u4E86\u5B83\u7684\u529F\u80FD\u2014\u2014\u4FEE\u9970\u540D\u8BCD\u3002</li></ul></li></ol><hr><h3 id="\u7B2C\u4E09\u90E8\u5206-\u54EA\u4E9B\u4E1C\u897F\u53EF\u4EE5\u5F53\u5B9A\u8BED-\u6838\u5FC3\u5185\u5BB9" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E09\u90E8\u5206-\u54EA\u4E9B\u4E1C\u897F\u53EF\u4EE5\u5F53\u5B9A\u8BED-\u6838\u5FC3\u5185\u5BB9" aria-hidden="true">#</a> \u7B2C\u4E09\u90E8\u5206\uFF1A\u54EA\u4E9B\u4E1C\u897F\u53EF\u4EE5\u5F53\u5B9A\u8BED\uFF1F\uFF08\u6838\u5FC3\u5185\u5BB9\uFF09</h3><p>\u5B9A\u8BED\u7684\u5BB6\u65CF\u975E\u5E38\u5E9E\u5927\uFF0C\u5F62\u5F0F\u591A\u6837\uFF0C\u4F4D\u7F6E\u7075\u6D3B\u3002\u6211\u4EEC\u628A\u5B83\u5206\u6210\u51E0\u5927\u7C7B\u6765\u770B\u3002</p><table><thead><tr><th style="text-align:left;">\u5145\u5F53\u5B9A\u8BED\u7684\u8BED\u6CD5\u5355\u4F4D</th><th style="text-align:left;">\u8BED\u6CD5\u5F62\u6001\u548C\u610F\u601D</th><th style="text-align:left;">\u4F8B\u53E5\uFF08<strong>\u5B9A\u8BED</strong>\u7528\u7C97\u4F53\u6807\u51FA\uFF0C\u5B83\u4FEE\u9970\u7684<em>\u540D\u8BCD</em>\u7528\u659C\u4F53\u6807\u51FA\uFF09</th></tr></thead><tbody><tr><td style="text-align:left;"><strong>1. \u5F62\u5BB9\u8BCD</strong></td><td style="text-align:left;"><strong>\u6700\u5E38\u7528\u7684\u4E00\u7C7B\uFF01</strong> \u8BF4\u660E\u4E8B\u7269\u7684\u6027\u8D28\u3001\u72B6\u6001\u3002\u901A\u5E38\u653E\u5728\u540D\u8BCD<strong>\u524D\u9762</strong>\u3002</td><td style="text-align:left;">She is a <strong>beautiful</strong> <em>girl</em>. \uFF08\u5979\u662F\u4E2A<strong>\u6F02\u4EAE\u7684</strong>\u5973\u5B69\u3002\uFF09<br>I have a <strong>red</strong> <em>car</em>. \uFF08\u6211\u6709\u4E00\u8F86<strong>\u7EA2\u8272\u7684</strong>\u6C7D\u8F66\u3002\uFF09</td></tr><tr><td style="text-align:left;"><strong>2. \u4EE3\u8BCD</strong></td><td style="text-align:left;">\u8BF4\u660E\u4E8B\u7269\u7684\u5F52\u5C5E\u3002</td><td style="text-align:left;"><strong>This</strong> <em>book</em> is mine. \uFF08<strong>\u8FD9\u672C</strong>\u4E66\u662F\u6211\u7684\u3002\uFF09<br><strong>My</strong> <em>mother</em> is a teacher. \uFF08<strong>\u6211\u7684</strong>\u5988\u5988\u662F\u8001\u5E08\u3002\uFF09</td></tr><tr><td style="text-align:left;"><strong>3. \u6570\u8BCD</strong></td><td style="text-align:left;">\u8BF4\u660E\u4E8B\u7269\u7684\u6570\u91CF\u6216\u987A\u5E8F\u3002</td><td style="text-align:left;">I have <strong>two</strong> <em>brothers</em>. \uFF08\u6211\u6709<strong>\u4E24\u4E2A</strong>\u5144\u5F1F\u3002\uFF09<br>This is my <strong>first</strong> <em>time</em>. \uFF08\u8FD9\u662F\u6211\u7684<strong>\u7B2C\u4E00\u6B21</strong>\u3002\uFF09</td></tr><tr><td style="text-align:left;"><strong>4. \u540D\u8BCD/\u540D\u8BCD\u6240\u6709\u683C</strong></td><td style="text-align:left;">\u8BF4\u660E\u4E8B\u7269\u7684\u6765\u6E90\u3001\u5F52\u5C5E\u6216\u6750\u8D28\u3002</td><td style="text-align:left;">This is a <strong>stone</strong> <em>bridge</em>. \uFF08\u8FD9\u662F\u4E00\u5EA7<strong>\u77F3</strong>\u6865\u3002\uFF09<br>This is <strong>Tom&#39;s</strong> <em>bike</em>. \uFF08\u8FD9\u662F<strong>\u6C64\u59C6\u7684</strong>\u81EA\u884C\u8F66\u3002\uFF09</td></tr><tr><td style="text-align:left;"><strong>5. \u4ECB\u8BCD\u77ED\u8BED</strong></td><td style="text-align:left;"><strong>\u975E\u5E38\u91CD\u8981\u7684\u4E00\u7C7B\uFF01</strong> \u7528\u4E00\u4E2A\u77ED\u8BED\u6765\u9650\u5B9A\u540D\u8BCD\uFF0C\u901A\u5E38\u653E\u5728\u540D\u8BCD<strong>\u540E\u9762</strong>\u3002</td><td style="text-align:left;">The <em>book</em> <strong>on the desk</strong> is mine. \uFF08<strong>\u684C\u5B50\u4E0A\u7684</strong>\u90A3\u672C\u4E66\u662F\u6211\u7684\u3002\uFF09<br>The <em>man</em> <strong>from China</strong> is my friend. \uFF08<strong>\u6765\u81EA\u4E2D\u56FD\u7684</strong>\u90A3\u4E2A\u7537\u4EBA\u662F\u6211\u7684\u670B\u53CB\u3002\uFF09</td></tr><tr><td style="text-align:left;"><strong>6. \u975E\u8C13\u8BED\u52A8\u8BCD\uFF08-ing/-ed/\u4E0D\u5B9A\u5F0F\uFF09</strong></td><td style="text-align:left;">\u7528\u4E00\u4E2A\u52A8\u4F5C\u7684\u6982\u5FF5\u6765\u4FEE\u9970\u540D\u8BCD\uFF0C\u8868\u793A\u4E3B\u52A8\u3001\u88AB\u52A8\u6216\u76EE\u7684\u3002</td><td style="text-align:left;">- <strong>\u73B0\u5728\u5206\u8BCD\uFF08-ing\uFF09</strong>: The <em>boy</em> <strong>sleeping in the room</strong> is my son. \uFF08<strong>\u6B63\u5728\u623F\u95F4\u91CC\u7761\u89C9\u7684</strong>\u7537\u5B69\u662F\u6211\u513F\u5B50\u3002\uFF09- <strong>\u8868\u4E3B\u52A8/\u8FDB\u884C</strong><br>- <strong>\u8FC7\u53BB\u5206\u8BCD\uFF08-ed\uFF09</strong>: I like the <em>bike</em> <strong>made in China</strong>. \uFF08\u6211\u559C\u6B22\u90A3\u8F86<strong>\u4E2D\u56FD\u5236\u9020\u7684</strong>\u81EA\u884C\u8F66\u3002\uFF09- <strong>\u8868\u88AB\u52A8/\u5B8C\u6210</strong><br>- <strong>\u4E0D\u5B9A\u5F0F\uFF08to do\uFF09</strong>: I have a <em>lot</em> <strong>to do</strong>. \uFF08\u6211\u6709\u5F88\u591A<strong>\u8981\u505A\u7684</strong>\u4E8B\u60C5\u3002\uFF09- <strong>\u8868\u5C06\u6765/\u76EE\u7684</strong></td></tr><tr><td style="text-align:left;"><strong>7. \u4ECE\u53E5\uFF08\u5B9A\u8BED\u4ECE\u53E5\uFF09</strong></td><td style="text-align:left;"><strong>\u7528\u4E00\u4E2A\u5B8C\u6574\u7684\u53E5\u5B50\u6765\u4FEE\u9970\u540D\u8BCD</strong>\uFF0C\u4F7F\u4FE1\u606F\u91CF\u7206\u70B8\u5F0F\u589E\u957F\u3002\u8FD9\u662F\u82F1\u8BED\u80FD\u529B\u7684\u4F53\u73B0\uFF01</td><td style="text-align:left;">The <em>man</em> <strong>who is standing there</strong> is my teacher. \uFF08<strong>\u6B63\u7AD9\u5728\u90A3\u513F\u7684</strong>\u90A3\u4E2A\u7537\u4EBA\u662F\u6211\u7684\u8001\u5E08\u3002\uFF09<br>This is the <em>house</em> <strong>where I was born</strong>. \uFF08\u8FD9\u5C31\u662F<strong>\u6211\u51FA\u751F\u7684</strong>\u90A3\u5EA7\u623F\u5B50\u3002\uFF09</td></tr></tbody></table><hr><h3 id="\u4E00\u4E2A\u6781\u5176\u91CD\u8981\u7684\u63D0\u9192-\u5B9A\u8BED\u7684\u4F4D\u7F6E-\u4E2D\u82F1\u6587\u6838\u5FC3\u5DEE\u5F02" tabindex="-1"><a class="header-anchor" href="#\u4E00\u4E2A\u6781\u5176\u91CD\u8981\u7684\u63D0\u9192-\u5B9A\u8BED\u7684\u4F4D\u7F6E-\u4E2D\u82F1\u6587\u6838\u5FC3\u5DEE\u5F02" aria-hidden="true">#</a> <strong>\u4E00\u4E2A\u6781\u5176\u91CD\u8981\u7684\u63D0\u9192\uFF1A\u5B9A\u8BED\u7684\u4F4D\u7F6E\uFF08\u4E2D\u82F1\u6587\u6838\u5FC3\u5DEE\u5F02\uFF09</strong></h3><p>\u8FD9\u662F\u4E2D\u56FD\u4EBA\u8BF4\u82F1\u8BED\u6700\u5BB9\u6613\u72AF\u9519\u7684\u5730\u65B9\uFF01</p><ul><li><strong>\u4E2D\u6587\u5B9A\u8BED</strong>\uFF1A<strong>\u51E0\u4E4E\u5168\u90E8</strong>\u653E\u5728\u88AB\u4FEE\u9970\u540D\u8BCD\u7684<strong>\u524D\u9762</strong>\u3002 <ul><li>\u4F8B\u5982\uFF1A\u6211\u6628\u5929\u4E70\u7684**\u4E66\u3002</li></ul></li><li><strong>\u82F1\u8BED\u5B9A\u8BED</strong>\uFF1A\u6709<strong>\u524D\u7F6E\u5B9A\u8BED</strong>\u548C<strong>\u540E\u7F6E\u5B9A\u8BED</strong>\u4E4B\u5206\u3002 <ul><li><strong>\u77ED\u7684\u5B9A\u8BED</strong>\uFF08\u5355\u8BCD\uFF09\u901A\u5E38<strong>\u524D\u7F6E</strong>\uFF1Aa <strong>beautiful</strong> garden</li><li><strong>\u957F\u7684\u5B9A\u8BED</strong>\uFF08\u77ED\u8BED\u3001\u4ECE\u53E5\uFF09\u5FC5\u987B<strong>\u540E\u7F6E</strong>\uFF1Athe garden <strong>behind my house</strong>\uFF08\u4ECB\u8BCD\u77ED\u8BED\u540E\u7F6E\uFF09\uFF0C the book <strong>that I bought yesterday</strong>\uFF08\u4ECE\u53E5\u540E\u7F6E\uFF09</li></ul></li></ul><p><strong>\u8BB0\u4F4F\u8FD9\u4E2A\u9EC4\u91D1\u6CD5\u5219\uFF1A\u5355\u8BCD\u591A\u524D\u7F6E\uFF0C\u957F\u53E5\u5FC5\u540E\u7F6E\u3002</strong></p><hr><h3 id="\u5B9A\u8BED\u4ECE\u53E5\u7684\u5FEB\u901F\u5165\u95E8" tabindex="-1"><a class="header-anchor" href="#\u5B9A\u8BED\u4ECE\u53E5\u7684\u5FEB\u901F\u5165\u95E8" aria-hidden="true">#</a> <strong>\u5B9A\u8BED\u4ECE\u53E5\u7684\u5FEB\u901F\u5165\u95E8</strong></h3><p>\u56E0\u4E3A\u5B9A\u8BED\u4ECE\u53E5\u592A\u91CD\u8981\u4E86\uFF0C\u6211\u4EEC\u7A0D\u5FAE\u5C55\u5F00\u4E00\u4E0B\u3002\u5B83\u7531<strong>\u5173\u7CFB\u8BCD</strong>\u5F15\u5BFC\uFF08who, which, that, where, when\u7B49\uFF09\uFF0C\u8FD9\u4E9B\u8BCD\u6709\u4E24\u4E2A\u4F5C\u7528\uFF1A</p><ol><li>\u8FDE\u63A5\u4E3B\u53E5\u548C\u4ECE\u53E5\u3002</li><li>\u5728\u4ECE\u53E5\u4E2D\u5145\u5F53\u4E00\u4E2A\u6210\u5206\uFF08\u5982\u4E3B\u8BED\u3001\u5BBE\u8BED\u3001\u72B6\u8BED\uFF09\u3002</li></ol><ul><li><strong>The woman is a doctor. + The woman lives next door.</strong></li><li>\u5408\u5E76\u4E3A\uFF1AThe woman <strong>who lives next door</strong> is a doctor. \uFF08\u4F4F\u5728\u9694\u58C1\u7684\u90A3\u4E2A\u5973\u4EBA\u662F\u533B\u751F\u3002\uFF09 <ul><li><code>who</code> \u6307\u4EE3 <code>the woman</code>\uFF0C\u5E76\u5728\u4ECE\u53E5\u4E2D\u4F5C\u4E3B\u8BED\u3002</li></ul></li></ul><h3 id="\u603B\u7ED3" tabindex="-1"><a class="header-anchor" href="#\u603B\u7ED3" aria-hidden="true">#</a> \u603B\u7ED3</h3><ol><li><strong>\u5B9A\u8BED\uFF08Attribute/Modifier\uFF09</strong> \u662F\u540D\u8BCD\u7684\u201C\u5316\u5986\u5E08\u201D\u548C\u201C\u8BF4\u660E\u5458\u201D\uFF0C\u8BA9\u540D\u8BCD\u53D8\u5F97\u5177\u4F53\u3001\u751F\u52A8\u3002</li><li>\u5B83\u7684\u5F62\u6001\u5343\u53D8\u4E07\u5316\uFF0C\u53EF\u4EE5\u662F<strong>\u5355\u8BCD\u3001\u77ED\u8BED\u3001\u4ECE\u53E5</strong>\u3002</li><li><strong>\u4F4D\u7F6E\u662F\u5173\u952E</strong>\uFF1A\u7262\u8BB0\u82F1\u8BED\u7684\u201C<strong>\u524D\u77ED\u540E\u957F</strong>\u201D\u539F\u5219\uFF0C\u8FD9\u662F\u533A\u522B\u4E8E\u4E2D\u6587\u7684\u6700\u5927\u7279\u70B9\u3002</li></ol><p>\u638C\u63E1\u4E86\u5B9A\u8BED\uFF0C\u4F60\u7684\u82F1\u8BED\u8868\u8FBE\u5C31\u4E0D\u518D\u662F\u201C\u4E00\u672C\u4E66\u201D\uFF08a book\uFF09\uFF0C\u800C\u662F\u201C\u90A3\u672C\u6211\u671F\u5F85\u5DF2\u4E45\u7684\u3001\u653E\u5728\u5E8A\u5934\u67DC\u4E0A\u7684\u3001\u5173\u4E8E\u5386\u53F2\u7684\u4E66\u201D\uFF08the book about history that I&#39;ve been looking forward to, which is on the nightstand\uFF09\u3002\u8FD9\u662F\u4E00\u4E2A\u8D28\u7684\u98DE\u8DC3\uFF01</p>',29),g=[e];function i(l,a){return r(),o("div",null,g)}var h=t(s,[["render",i],["__file","index.html.vue"]]);export{h as default};
